import axios from "axios";
import { useEffect } from "react";

const GetQuote = () => {
    const getPosts = async () => {
        try {
            const userPosts = await axios.get(`https://goquotes-api.herokuapp.com/api/v1/random/100?type=author&val=author`)

            console.log(userPosts.author);

        } catch (err) {
            console.error(err.message);
        }
    };
    useEffect(() => {

        getPosts()
    })

}
export default GetQuote;
